import { Link } from "react-router-dom";
import NavbarFirst from "./NavbarFirst";
import NavbarLast from "./NavbarLast";

const Navbar = () => {
  return (
    <div className="max-w-full flex justify-between items-center sm:mx-5 md:mx-14 py-5 text-sm">
      <NavbarFirst />
      <div className="sm:text-xl md:text-3xl">
        <Link to="/">THE STORE</Link>
      </div>
      <NavbarLast />
    </div>
  );
};

export default Navbar;
